import React from 'react';
import ReactDOM from 'react-dom';
import './About.css';
import Home from './Home';
import About from "./About";
import logo from './img/logo.png';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            home: true,
            about: false,
            portfolio: false
        }
    }

    isHome() {
        if (this.state.home) {
            return "opacity: 1";
        }
        return ""
    }

    render() {
        return (
            <div>
                <header>
                        <a id="logo"><img class="clickable" style={{opacity: 1}} src={logo}/></a>
                        <nav>
                            <a class="unselected clickable">About</a>
                            <a class="unselected clickable">Portfolio</a>
                        </nav>
                </header>
                <Home />
            </div>
        );
    }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
